import React from "react";
import {useParams} from "react-router-dom";
const User = () => {
    const {fname ,lname} = useParams();
    return (
        <>
            <h1>Hi You are Looking New User</h1>
            <h1>Hi You Are An Intermidate User</h1>
            <h1>hi {fname}  {lname}  You Are A Premium User</h1>
        </>
    )
}

export default User;
